#!/usr/bin/python3

sdrData = ''
array = [sdrData[i:i+2] for i in range(0, len(sdrData), 2)]

bitString = ""
for a in array:
	if a == '01':
		bitString += "1"
	elif a == '10':
		bitString += "0"
	else:
		print("Error!")
		exit()

chars = [chr(int(bitString[i:i+8], 2)) for i in range(0, len(bitString), 8)]
flag = "".join(chars)
print(flag)
